import React, { useState, useEffect } from 'react';
import { RotateCcw, Pause, Play, Settings } from 'lucide-react';

const TasbihCounter: React.FC = () => {
  const [count, setCount] = useState(0);
  const [target, setTarget] = useState(33);
  const [isActive, setIsActive] = useState(false);
  const [currentDhikr, setCurrentDhikr] = useState(0);
  const [showSettings, setShowSettings] = useState(false);

  const dhikrList = [
    { arabic: 'سُبْحَانَ اللَّهِ', latin: 'Subhanallah', meaning: 'Maha Suci Allah' },
    { arabic: 'الْحَمْدُ لِلَّهِ', latin: 'Alhamdulillah', meaning: 'Segala puji bagi Allah' },
    { arabic: 'اللَّهُ أَكْبَرُ', latin: 'Allahu Akbar', meaning: 'Allah Maha Besar' },
    { arabic: 'لَا إِلَهَ إِلَّا اللَّهُ', latin: 'La ilaha illallah', meaning: 'Tiada Tuhan selain Allah' },
    { arabic: 'أَسْتَغْفِرُ اللَّهَ', latin: 'Astaghfirullah', meaning: 'Saya mohon ampun kepada Allah' },
    { arabic: 'لَا حَوْلَ وَلَا قُوَّةَ إِلَّا بِاللَّهِ', latin: 'La hawla wa la quwwata illa billah', meaning: 'Tidak ada daya dan kekuatan kecuali dari Allah' }
  ];

  const targetOptions = [11, 33, 100, 1000];

  // Simpan ke localStorage
  useEffect(() => {
    localStorage.setItem('tasbihCount', count.toString());
    localStorage.setItem('tasbihTarget', target.toString());
    localStorage.setItem('currentDhikr', currentDhikr.toString());
  }, [count, target, currentDhikr]);

  // Load dari localStorage
  useEffect(() => {
    const savedCount = localStorage.getItem('tasbihCount');
    const savedTarget = localStorage.getItem('tasbihTarget');
    const savedDhikr = localStorage.getItem('currentDhikr');
    
    if (savedCount) setCount(parseInt(savedCount));
    if (savedTarget) setTarget(parseInt(savedTarget));
    if (savedDhikr) setCurrentDhikr(parseInt(savedDhikr));
  }, []);

  const handleIncrement = () => {
    if (count < target) {
      setCount(prev => prev + 1);
      
      // Vibrate jika didukung
      if (navigator.vibrate) {
        navigator.vibrate(50);
      }
      
      // Suara klik jika tersedia
      try {
        const audio = new Audio('data:audio/wav;base64,');
      } catch (error) {
        // Fallback jika audio tidak bisa dimainkan
      }
      
      // Cek apakah sudah mencapai target
      if (count + 1 >= target) {
        // Pindah ke dhikr berikutnya atau reset
        if (currentDhikr < dhikrList.length - 1) {
          setCurrentDhikr(prev => prev + 1);
          setCount(0);
        } else {
          // Selesai semua dhikr, bisa reset atau berhenti
          setIsActive(false);
        }
      }
    }
  };

  const handleReset = () => {
    setCount(0);
    setIsActive(false);
  };

  const handleTargetChange = (newTarget: number) => {
    setTarget(newTarget);
    setCount(0);
  };

  const handleDhikrChange = (index: number) => {
    setCurrentDhikr(index);
    setCount(0);
  };

  const progress = (count / target) * 100;
  const currentDhikrData = dhikrList[currentDhikr];

  return (
    <div className="bg-white rounded-2xl shadow-lg p-6 border border-emerald-100">
      <div className="flex items-center justify-between mb-6">
        <div className="flex items-center">
          <div className="w-8 h-8 bg-emerald-600 rounded-full flex items-center justify-center mr-3">
            <span className="text-white font-bold text-sm">📿</span>
          </div>
          <h2 className="text-xl font-bold text-gray-800">Tasbih Digital</h2>
        </div>
        <button
          onClick={() => setShowSettings(!showSettings)}
          className="p-2 text-emerald-600 hover:bg-emerald-50 rounded-lg transition-colors"
        >
          <Settings className="w-5 h-5" />
        </button>
      </div>

      {showSettings && (
        <div className="mb-6 p-4 bg-emerald-50 rounded-lg space-y-4">
          <div>
            <h3 className="font-semibold text-emerald-800 mb-2">Target Hitungan</h3>
            <div className="flex gap-2">
              {targetOptions.map((option) => (
                <button
                  key={option}
                  onClick={() => handleTargetChange(option)}
                  className={`px-3 py-2 rounded-lg text-sm font-medium transition-colors ${
                    target === option 
                      ? 'bg-emerald-600 text-white' 
                      : 'bg-white text-emerald-600 border border-emerald-200 hover:bg-emerald-100'
                  }`}
                >
                  {option}x
                </button>
              ))}
            </div>
          </div>
          
          <div>
            <h3 className="font-semibold text-emerald-800 mb-2">Pilih Dhikr</h3>
            <select
              value={currentDhikr}
              onChange={(e) => handleDhikrChange(parseInt(e.target.value))}
              className="w-full p-2 border border-emerald-200 rounded-lg focus:ring-2 focus:ring-emerald-300 focus:border-emerald-300"
            >
              {dhikrList.map((dhikr, index) => (
                <option key={index} value={index}>
                  {dhikr.latin} - {dhikr.meaning}
                </option>
              ))}
            </select>
          </div>
        </div>
      )}

      {/* Dhikr Display */}
      <div className="text-center mb-6">
        <div className="mb-4 p-4 bg-emerald-50 rounded-lg">
          <p className="text-2xl arabic-font text-emerald-800 mb-2" dir="rtl">
            {currentDhikrData.arabic}
          </p>
          <p className="text-lg font-semibold text-emerald-700 mb-1">
            {currentDhikrData.latin}
          </p>
          <p className="text-sm text-emerald-600">
            {currentDhikrData.meaning}
          </p>
        </div>
      </div>

      {/* Counter Display */}
      <div className="text-center mb-6">
        <div className="relative w-32 h-32 mx-auto mb-4">
          <svg className="w-32 h-32 transform -rotate-90" viewBox="0 0 100 100">
            <circle
              cx="50"
              cy="50"
              r="40"
              stroke="currentColor"
              strokeWidth="8"
              fill="transparent"
              className="text-emerald-200"
            />
            <circle
              cx="50"
              cy="50"
              r="40"
              stroke="currentColor"
              strokeWidth="8"
              fill="transparent"
              strokeDasharray={`${2 * Math.PI * 40}`}
              strokeDashoffset={`${2 * Math.PI * 40 * (1 - progress / 100)}`}
              className="text-emerald-600 transition-all duration-300"
              strokeLinecap="round"
            />
          </svg>
          <div className="absolute inset-0 flex items-center justify-center">
            <div className="text-center">
              <div className="text-3xl font-bold text-emerald-600">{count}</div>
              <div className="text-sm text-emerald-500">/ {target}</div>
            </div>
          </div>
        </div>
      </div>

      {/* Controls */}
      <div className="flex justify-center space-x-4 mb-4">
        <button
          onClick={handleIncrement}
          disabled={count >= target}
          className="bg-emerald-600 hover:bg-emerald-700 disabled:bg-emerald-300 text-white px-8 py-4 rounded-full text-lg font-semibold transition-colors flex items-center justify-center min-w-[120px]"
        >
          {count >= target ? 'Selesai ✓' : 'Tasbih'}
        </button>
        
        <button
          onClick={handleReset}
          className="bg-gray-500 hover:bg-gray-600 text-white px-6 py-4 rounded-full transition-colors"
        >
          <RotateCcw className="w-5 h-5" />
        </button>
      </div>

      {/* Status */}
      <div className="text-center">
        {count >= target ? (
          <div className="text-emerald-600 font-semibold">
            Alhamdulillah! Target tercapai 🎉
          </div>
        ) : (
          <div className="text-gray-600">
            Sisa {target - count} lagi
          </div>
        )}
      </div>

      {/* Tips */}
      <div className="mt-4 p-3 bg-yellow-50 border border-yellow-200 rounded-lg">
        <p className="text-sm text-yellow-700 text-center">
          <strong>Tips:</strong> Bacalah dengan khusyuk dan renungkan makna setiap dhikr
        </p>
      </div>
    </div>
  );
};

export default TasbihCounter;